const styles = (theme) => ({
  adminIcon: {
    color: theme.palette.success.main,
  },
  item: {
    padding: theme.spacing(1),
  },
  isAdminCell: {
    width: 50,
    textAlign: 'center',
  },
  input: {
    maxWidth: 200,
  },
  departmentCell: {
    maxWidth: 300,
  },
  officeCell: {
    maxWidth: 300,
  },
});

export default styles;
